    {
      name: "paymentType",
      title: "Payment Type",
      type: "string",
      options: {
        list: [
          { value: "fixed", title: "Fixed Fee (to museum services)" },
          { value: "range", title: "Donation Range (to development)" },
        ],
        layout: "radio",
      },
      validation: (Rule) => Rule.required(),
    },
    {
      name: "yearlyPrice",
      title: "Yearly Price",
      description:
