 *    type: 'portableText'
 *  }
 */
export default {
  title: "Portable Text",
  name: "portableText",
  type: "array",
  of: [
    // TODO add many more content types here so that users can easily add a CTA/button/custom components/etc. to their page
    // { type: "reference", to: [{ type: "collectionItem" }] },
    // { type: "figure", title: "Image" },
