        "If this tour may be taken virtually, please provide details for the logistics of the virtual tour.",
      options: {
        collapsible: true,
      },
      // fieldset: "bookingOptions",
    },
    {
      name: "imageGallery",
      title: "Image Gallery",
      type: "array",
      of: [{ type: "figure" }],
      options: {
        layout: "grid",
      },
      // TODO description...what types of images are in this field?
